class TableItems extends React.Component {

    render() {
        return (
            <div className="ui cards" style={{margin:"0px 10px"}}>
                <div className="card">
                    <div className="content">  
                        <div className="center aligned header" style={{marginTop:"5px"}}>Noces de Cotton</div> 
                        <div className="center aligned meta">3 Places disponibles</div>
                        <br/>
                        <div className="description" style={{marginBottom:"10px"}}>
                            <div className="ui celled ordered list">
                                <div className="item red">Couple Wawa Leonard</div>
                                <div className="item">Couple CÃ©dric Wawa</div>
                                <div className="item">Couple Solotshi</div>
                                <div className="item">Eliel et Esther</div>
                                <div className="item">Jaspe et Espoir</div>
                                <div className="item">Mamina Leo</div>
                                <div className="item">Couple Max Mpoy</div>
                            </div>
                        </div>
                    </div>
                </div>
            </div>
        );
    }
}

export default TableItems;
